// Calculator.js
import React, { useState } from "react";
import Layout from "./Layout";

const Calculator = () => {
  // Состояния для ввода данных
  const [district, setDistrict] = useState("");
  const [rooms, setRooms] = useState(1);
  const [totalArea, setTotalArea] = useState(0);
  const [constructionYear, setConstructionYear] = useState(2000);
  const [buildingFloors, setBuildingFloors] = useState(1);
  const [userAge, setUserAge] = useState(30);
  const [result, setResult] = useState(null);

  // Функция для отправки данных на сервер
  const calculateRent = async () => {
    const response = await fetch("/cost/calculate", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify({
        district,
        rooms,
        totalArea,
        constructionYear,
        buildingFloors,
        userAge,
      }),
    });

    const data = await response.json();
    setResult(data);
  };

  return (
    <Layout>
      <main className="container mx-auto py-12 px-6">
        <h2 className="text-2xl md:text-4xl font-bold mb-6 text-center">Калькулятор ренты</h2>

        <div className="max-w-4xl mx-auto">
          <div className="mb-4">
            <label>Район:</label>
            <input type="text" value={district} onChange={(e) => setDistrict(e.target.value)} />
          </div>
          <div className="mb-4">
            <label>Количество комнат:</label>
            <input type="number" value={rooms} onChange={(e) => setRooms(e.target.value)} min="1" />
          </div>
          <div className="mb-4">
            <label>Общая площадь (кв. м):</label>
            <input type="number" value={totalArea} onChange={(e) => setTotalArea(e.target.value)} min="1" />
          </div>
          <div className="mb-4">
            <label>Год постройки:</label>
            <input type="number" value={constructionYear} onChange={(e) => setConstructionYear(e.target.value)} />
          </div>
          <div className="mb-4">
            <label>Этажность здания:</label>
            <input type="number" value={buildingFloors} onChange={(e) => setBuildingFloors(e.target.value)} min="1" />
          </div>
          <div className="mb-4">
            <label>Возраст пользователя:</label>
            <input type="number" value={userAge} onChange={(e) => setUserAge(e.target.value)} min="1" />
          </div>
          <button onClick={calculateRent} className="bg-blue-500 text-white p-2 rounded">Рассчитать</button>

          {result && (
            <div className="mt-6">
              <h3 className="text-xl font-bold">Результаты:</h3>
              <p>Единовременный платеж: {result.oneTimePayment}</p>
              <p>Ежемесячный платеж: {result.monthlyPayment}</p>
            </div>
          )}
        </div>
      </main>
    </Layout>
  );
};

export default Calculator;
